import Head from 'next/head'
const Layout = props => (
  <div>
    <Head>
      <title>Students</title>
    </Head>
    {props.children}
    <style jsx>
      {`
        div{
          background: #000;
        }
      `}
    </style>
  </div>
);

export default Layout;
